import './index.css'

export default function ItemListContainer () {
    return (
        <h5 className='textoCatalogo bg-info text-wrap strong'>Somos un emprendimiento joven dedicado a la venta de productos para el mate, buscando ofrecer gran variabilidad y accesibilidad para todos los gustos. 
            Fieles convencidos de que la felicidad está en el contacto humano y qué mejor que unos buenos mates para compartir momentos !
        </h5>
    );
}
